import React, { useState } from "react";
import Invoice from "./Invoice/Invoice";


function App() {

  const [parcedState, setParcedState] = useState();

  async function fetchedUrl() {
    let data = await fetch('https://rscdev.taxadda.com/api/invoice/list');
    let parcedData = await data.json();
    console.log(parcedData);
  }


  fetchedUrl();

  return (
    <div className="App">
     <nav className="navbar nav-expand navbar-dark bg-primary">
        <ul className="navbar-nav fs-5 text-white">
            <h1 className="position-center">INVOICE APP</h1>
        </ul>
     </nav>
     <Invoice />
    </div>
  );
}

export default App;
